import React, { useEffect, useState } from "react";
import axios from "axios";
export default function FormSubmissions() {
  const [forms, setForms] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:5000/forms/getforms").then((res) => {
      // console.log(res);

      setForms(res.data);
    });
    //console.log(forms);

    //console.log(forms);
  }, []);

  useEffect(() => {
    console.log(forms);

    //console.log(forms);
  }, [forms]);

  return (
    <div>
      <table style={{ width: "50%" }}>
        <tr>
          <td>form label</td>
          <td>input name</td>
          <td>input type</td>
        </tr>
      </table>
      {forms.map((form) => {
        return (
          <table style={{ width: "40%" }}>
            <tr>
              <td>{form.formLabel}</td>
              <td>{form.inputName}</td>
              <td>{form.inputType}</td>
            </tr>
          </table>
        );
      })}
    </div>
  );
}
